@Override
public int endOffset() throws IOException {
  int endOffset = leadEndOffset;
  for (PhrasePositions pp : phrasePositions) {
    if (pp.ord != leadOrd) {
      endOffset = Math.max(endOffset, pp.postings.endOffset());
    }
  }
  return endOffset;
}

